const SonataCard = ({ ordinal }) => {
    console.log("passed Sonata", ordinal);

    return (
      <div className={`rounded-lg overflow-hidden m-4 p-4 bg-white border-4 border-black shadow-xl hover:bg-gray-300`}>
        <div className="px-6 py-4">
        {/* <div className="font-bold mb-2 text-xs overflow-wrap"><a href={`https://whatsonchain.com/${ordinal.txid}`}>{ordinal.txid}</a></div> */}
        <div className="font-bold text-lg mb-2">Artist: {ordinal.data.insc.metadata.artist}</div>
        <div className="font-bold text-lg mb-2">Title: {ordinal.data.insc.metadata.songName}</div>
        <div className="font-bold text-lg mb-2">Format: {ordinal.data.insc.metadata.format}</div>
        <div className="font-bold text-lg mb-2">Genre: {ordinal.data.insc.metadata.genre}</div>
        <div className="font-bold text-lg mb-2">Label: {ordinal.data.insc.metadata.label}</div>
        <div className="font-bold text-lg mb-2">Released: {ordinal.data.insc.metadata.releaseDate}</div>
        </div>
      </div>
    );
  };

  export default SonataCard;
